import react from "react";
import NavBar from "./Components/NavBar";
import { Route, Switch } from 'react-router-dom';

function App() {



  return (
    <div>
      <NavBar/>
      <Switch>

        <Route exact path='/'>
          <Home/>
        </Route>

        <Route exact path='/add-new-costumer'>
          <AddNewCostumer/>
        </Route>



      </Switch>


    </div>
  );
}

export default App;
